script: |
  super -f text -I q13202.spq | sort > q13202.out

inputs:
  - name: q13202.spq
    data: |
      SELECT ALL col2 AS col1 FROM tab0 (FORMAT parquet) cor0 WHERE NULL NOT BETWEEN ( col1 / col0 * - ( - 66 * col1 ) ) AND ( + col1 / - 40 );
  - name: tab0

outputs:
  - name: q13202.out
    data: |
